        culpa atque eum, obcaecati quidem saepe beatae totam cupiditate sed,
        placeat adipisci id ipsam consequatur earum! Quos, vel odit! Ullam.
      </p>
      <button onClick={() => onSearch}>Agregar</button>
    </div>
  );
};
export default SearchBar;
